import './App.css';
import { useState, useEffect } from "react";

//functions
import { getTest } from "./functions/test";
function App() {
  const [data, setData] = useState("Hello World!");

  useEffect(() => {
    getTest()
      .then((res) => {
        setData(res.message);
        console.log(res);
      })
      .catch((err) => console.log(err));
  }, []);
  return (
    <div className="App">
      <header> This is Header</header>
      <h1>{data}</h1>
    </div>
  );


}



export default App;
